import React from "react";

import "./Spinner.css";

export default function Spinner(props) {
  return (
    <div className="Spinner Spinner--primary Spinner--md">
      <span className="Spinner_dot Spinner_dot--first"></span>
      <span className="Spinner_dot Spinner_dot--second"></span>
      <span className="Spinner_dot Spinner_dot--third"></span>
    </div>
  );
}
